let micInitialization = () => {
    if (navigator.mediaDevices) {
        console.log('getUserMedia supported.');
        var constraints = { 
            audio: /*true*/ {
                sampleRate : {
                    exact : 44100 // 44.1KHz (DW)
                }
            } 
        };
        var chunks = [];

        // console.log("supported consraints");
        // console.log(navigator.mediaDevices.getSupportedConstraints())

        // Get mic audio
        navigator.mediaDevices.getUserMedia(constraints)
        .then(function(stream) {
            
            // myconstraints = {
            //     sampleRate : { ideal : 44100 }, 
            //     sampleSize : { exact : 8}
            // }
            // console.log("constraints")
            // console.log(myconstraints);
            // console.log("Tracks");
            // stream.getTracks().forEach(function(track) {
            //     track.applyConstraints(myconstraints); // doesn't do anything
            //     console.log(track.getSettings());
            //     console.log(track.getCapabilities());
            // })

            var options = {
                audioBitsPerSecond : 128000,
                mimeType: 'audio/webm;codec=pcm'
            };

            var mediaRecorder = new MediaRecorder(stream, options);
            
            // var videoElement = document.getElementById("video-content");

            mediaRecorder.start();
            console.log("recorder started");
            console.log(mediaRecorder.state);
            

            setTimeout(function() {
                mediaRecorder.stop();
                console.log(mediaRecorder.state);
                console.log("recorder ended");
            }, 10000);

            
            // start recording on video play
            // videoElement.onplay = () => {
            //     mediaRecorder.start();
            //     console.log(mediaRecorder.state);
            //     console.log("recorder started");
            // }
            
            // stop recording on video pause
            // videoElement.onpause = () => {
            //     mediaRecorder.stop();
            //     console.log(mediaRecorder.state);
            //     console.log("recorder ended");
            // }
            

            // recording stopped
            mediaRecorder.onstop = function(e) {
                const currentChunkBlob = new Blob(chunks);

                let currentGameID = 321213; // associated with the specific user and contentID
                let currentContentID = 1231231; // id for the specific content (movie, episode)
                let currentDiaglogueID = 3; // index of the dialog array
                let currentAudioBlob = currentChunkBlob;
                
                console.log("sending compareDialog Message...");
                socket.emit("compareDialogue", { 
                    gameID : currentGameID,
                    contentID : currentContentID,
                    dialogueID :  currentDiaglogueID,
                    audioBlob : currentAudioBlob
                });
                console.log("sent compareDialog Message");
            }

            
            // recording data available
            mediaRecorder.ondataavailable = function(e) {
                chunks = [];
                chunks.push(e.data);
                console.log("e ondataavailable");
                console.log(e);
                console.log("e.data ondataavailable");
                console.log(e.data);
            }
    
        })
        .catch(function(err) {
            console.log('The following error occurred: ' + err);
        });
    };
} 